package variable;

public class whileTest {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i = 1;
		while(i <= 10) {
			System.out.print(i + "\t");
			i++;
		}
		
		System.out.println();
		
		int j = 100;
		while(j >= 90) {
			System.out.print(j + "\t");
			j--;
		}

	}

}
